import React from "react";

//Import Components
import { useMainBox } from "../contexts/MainBoxContext";
import ScreenType from "../enuns/ScreenType";
import Header from "./Header";
import Body from "./Body";


const MainBox = () => {
  const { screen } = useMainBox();
  const isScreenToNotShowNavBars = 
  ScreenType.WELCOME ||
  ScreenType.CADASTROS ||
  ScreenType.CADASTROSFISICA ||
  ScreenType.CADASTROSFORNECEDOR ||
  ScreenType.CADASTROSJURIDICA
  return (
    <React.Fragment>
      {
        screen !== isScreenToNotShowNavBars && 
      <>
        <Header/>
        <Body/>
      </>
      }
    </React.Fragment>
  );
};

export default MainBox;
